import './App.css';
import React from 'react';
import { BrowserRouter } from 'react-router-dom';
import Home from './components/Home'

function App() {
  return (
    <div className="App">
        <BrowserRouter>
            <Route path='/' element={<Home />}></Route>
        </BrowserRouter>
    </div>
  );
}

export default App;
